import React from "react";
import {
  Drawer as MUIDrawer,
  ListItem,
  List,
  ListItemIcon,
  ListItemText
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import { withRouter } from "react-router-dom";
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import clsx from 'clsx';
import SvgIcon from '@material-ui/core/SvgIcon';

const useStyles = makeStyles({
  drawer: {
    width: "68px"
  },
  drawerPaper: {
    color: "#252F4A"
  },
  drawerList: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column'
  },
  listItemContainer: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent:"center",
    padding: 0,
    color: "#FFF",
  },
  listIcon: {
    color: "#FFF",
    justifyContent: 'center'
  },
  exit: {
    marginTop: 'auto'
  },
});

const Drawer = props => {
  const { history } = props;
  const classes = useStyles();
  const itemsList = [
    {
      text: "Россети",
      icon: <SvgIcon><path d="M 33.92,0.78
      C 33.92,0.78 33.92,39.33 33.92,39.33
        33.92,39.33 -1.54,39.33 -1.54,39.33
        -1.54,39.33 -1.54,0.78 -1.54,0.78
        -1.54,0.78 33.92,0.78 33.92,0.78 Z" /></SvgIcon>,
      onClick: () => history.push("/")
    },
    {
      text: "Кабинет",
      icon: <PermIdentityIcon />,
      onClick: () => history.push("/profile")
    }
  ];
  return (
    <MUIDrawer variant="permanent" className={classes.drawer}>
      <List className={classes.drawerList}>
        {itemsList.map((item, index) => {
          const { text, icon, onClick } = item;
          return (
            <ListItem button key={text} onClick={onClick} className={classes.listItemContainer}>
              {icon && <ListItemIcon className={classes.listIcon}>{icon}</ListItemIcon>}
              <ListItemText primary={text} />
            </ListItem>
          );
        })}
        <ListItem button className={ clsx(classes.listItemContainer, classes.exit)}>
          <ListItemIcon className={classes.listIcon}>
            <ExitToAppIcon />
          </ListItemIcon>
          <ListItemText primary="Выход" />
        </ListItem>
      </List>


    </MUIDrawer>
  );
};

export default withRouter(Drawer);
